import Layout from "../components/layout/layout";

function Dashboard() {
  return (
    <Layout>
      <div>
        <p>Profile</p>
        <p>Inbox</p>
        <p>Orders</p>
        <p>Favourites</p>
        <p>Settings</p>
      </div>
    </Layout>
  );
}

export default Dashboard;
